import React, { useState } from "react";
import "../styles.css";
import jsPDF from "jspdf";

const MitigationForm = () => {
  const [formData, setFormData] = useState({
    customerName: "",
    jobAddress: "",
    claimNumber: "",
    jobType: "",
    equipmentUsed: "",
    paymentStatus: "",
    waitingInsurance: "",
    technicianNotes: "",
  });

  const [rooms, setRooms] = useState([{ name: "", readings: "", photo: null }]);
  const [psychrometrics, setPsychrometrics] = useState("");
  const [aiPsychrometrics, setAiPsychrometrics] = useState("");

  const handleFormChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleRoomChange = (index, key, value) => {
    const updatedRooms = [...rooms];
    updatedRooms[index][key] = value;
    setRooms(updatedRooms);
  };

  const addRoom = () => {
    setRooms([...rooms, { name: "", readings: "", photo: null }]);
  };

  const generateAIpsychrometrics = () => {
    setAiPsychrometrics(
      `Psychrometric Analysis:
‚Ä¢ Dry Bulb Temp: 72¬∞F
‚Ä¢ Relative Humidity: 45%
‚Ä¢ Dew Point: 48¬∞F
‚Ä¢ Grains Per Pound: 35 GPP
‚Ä¢ Vapor Pressure: 0.42 inHg

These values meet drying standards per IICRC S500.`
    );
  };

  const generatePDF = () => {
    const doc = new jsPDF();
    doc.text("üõ† Mitigation Report - ToolbeltAI", 10, 10);

    // Customer Info
    doc.text(`Customer Name: ${formData.customerName}`, 10, 30);
    doc.text(`Job Address: ${formData.jobAddress}`, 10, 40);
    doc.text(`Claim Number: ${formData.claimNumber}`, 10, 50);
    doc.text(`Job Type: ${formData.jobType}`, 10, 60);

    // Rooms Section
    doc.text("üìç Room Readings:", 10, 80);
    rooms.forEach((room, index) => {
      doc.text(
        `${index + 1}. ${room.name} ‚Äì Readings: ${room.readings}`,
        10,
        90 + index * 10
      );
    });

    // Psychrometrics
    doc.text("üå° Psychrometric Table:", 10, 130);
    doc.text(doc.splitTextToSize(aiPsychrometrics, 180), 10, 140);

    doc.save("mitigation_report.pdf");
  };

  return (
    <div className="form-container">
      <h2>üõ† ToolbeltAI Mitigation Logger</h2>

      {/* Customer Details */}
      <div className="form-section">
        <h3>üìç Customer & Job Info</h3>
        <input name="customerName" placeholder="Customer Name" onChange={handleFormChange} />
        <input name="jobAddress" placeholder="Job Address" onChange={handleFormChange} />
        <input name="claimNumber" placeholder="Claim #" onChange={handleFormChange} />

        <select name="jobType" onChange={handleFormChange}>
          <option value="">Select Job Type</option>
          <option>Water Damage</option>
          <option>Fire Damage</option>
          <option>Mold Remediation</option>
          <option>Sewage Backup</option>
          <option>Storm Damage</option>
        </select>
      </div>

      {/* Rooms Section */}
      <div className="form-section">
        <h3>üì¶ Room Moisture Readings & Photos</h3>
        {rooms.map((room, index) => (
          <div key={index} className="room-card">
            <input
              placeholder="Room Name (e.g., Master Bedroom)"
              onChange={(e) => handleRoomChange(index, "name", e.target.value)}
            />
            <textarea
              placeholder="Moisture Readings (e.g., 23% South Wall)"
              onChange={(e) => handleRoomChange(index, "readings", e.target.value)}
            />
            <input
              type="file"
              accept="image/*"
              onChange={(e) => handleRoomChange(index, "photo", e.target.files[0])}
            />
          </div>
        ))}
        <button onClick={addRoom}>‚ûï Add Another Room</button>
      </div>

      {/* Psychrometrics */}
      <div className="form-section">
        <h3>üå° Psychrometric Table</h3>
        <textarea
          placeholder="Enter psychrometric data OR click AI"
          onChange={(e) => setPsychrometrics(e.target.value)}
        />
        <button onClick={generateAIpsychrometrics}>‚öôÔ∏è AI Generate Table</button>

        {aiPsychrometrics && (
          <div className="ai-box">
            <h4>Generated Table:</h4>
            <p>{aiPsychrometrics}</p>
          </div>
        )}
      </div>

      {/* PDF */}
      <button onClick={generatePDF}>üìÑ Export Insurance PDF</button>
    </div>
  );
};

export default MitigationForm;
